import { useParams } from "react-router-dom";
import dessert from "../Component/product_detail";

export default function Product() {
  const { kind } = useParams();
  return (
    <Box w="100vw" h="100vh" bgColor="#ffe067">
      <Image src={dessert.kind.url} />
    </Box>
  );
}
